const ItemCart = ({item}) => {
    return (
        <div className="item-cart">
            <div className="img-item">
                <img src={`/products/${item.img}`} alt="Imagen del producto" height="40px"/>
            </div>
            <div>{`x${item.ud}`}</div>
            <div>{`precio: ${item.price*item.ud}`}</div>
        </div>
    )
}

export default ItemCart;
